def isBig(char):
    return (ord(char) <= 90 and ord(char) >= 65)

def isSmall(char):
    return (ord(char) <= 122 and ord(char) >= 97)

def testMatch(string):
    if any([isBig(string[0]),isBig(string[4]),isBig(string[8]),isSmall(string[1]),isSmall(string[2]),isSmall(string[3]),isSmall(string[5]),isSmall(string[6]),isSmall(string[7])]):
        return False
    return True
    
